import RegisterForm from "../../../components/RegisterForm";
import "./Login.scss";

export default function Login() {
  const { Content } = Layout;
  const { TabPane } = Tabs;
  return (
    <Layout className="login">
      <Content className="login-content"></Content>
    </Layout>
  );
}
